export const leftNav1 = tabDataIndexFairsConfig;
export const leftNav2 = tabDataIndexNoticesConfig;
export const leftNav3 = unitZhaopinTabData;

// 头部导航nav高亮
export const headerNav = {
  10: 'home',
  11: 'student',
  12: 'unit',
  13: 'branch',
  14: 'about',
  15: 'lianmeng',
}
